e stones of fortune\nFor the journey has begun,\nYes it has begun\n\nSo you do,\nSo you want to be giving\nSay it out loud if you need to be holy\nSo you do,\nSo you want to be loving\nSay it out now\nIf you need to be holier still\n\n[added Quad lyrics only:]\nSay you do, Say you want to be giving\nSay it out loud if you need to be holy,\n\nAnd you do and you want to be loving\nSay it out now\nIf you need to be holier still\n\nSo it seems or so it may be\nI can\'t know for sure but lately seems\nI\'m on a journey\nTo a place I\'ve never been\n\nAnd baby if I had the answers\nI would lay them all before you\nPlainly it\'s a circle,\nOne that ends and then begins,\nAnd begins again\nYes I will,\n\'Deed I will if I can\n'),(209,'','2017-11-29 18:31:21','Reggae Strut','9a024b9e-160a-3d6a-a206-ffd77b7cc8e7',230666,0,7,NULL,NULL,20,'\n\r\nSome dey do, some dey don\'t do\nSome dey won\'t do,,\nSome won\'t even try\nHow are you to know\nYou got to go and ask it\nHow are you go and ask it\nMaybe you move it by\n\nPardon me\nMaybe you like to dance it\nMaybe you like to chance it\nMaybe you like to try\n\nMaybe lady do Reggae Strut\nMaybe lady she do okay\nMaybe lady do Reggae\nMaking de hips sway, movin\' it okay\n\nSome dey wait, some dey can\'t wait\nSome dey won\'t wait\nSome don\'t even try\n\nTry like me, pick up the elbow higher\nKick up de foot and glide it\nYou got to dance it by\n\nMaybe lady do Reggae Strut\nMaybe lady she do okay\nMaybe lady do Reggae\nMaking de hips sway, movin\' it okay\n\nDat\'s de way, you got the right motion\nYou got the right notion\nNow maybe you dance it by\nHey de lady do Reggae Strut\nHey de lady she do okay\nHey de lady do Reggae\nMaking the hips sway, movin\' it okay\n'),(210,'','2017-11-29 18:31:22','The Gift of Song','914dc652-1c90-3526-be46-c9fb493342af',142200,0,8,NULL,NULL,20,'\n\r\nSongs to make you free\nAnd songs to take you to another time\nForgotten reasons that are made of rhyme\nFor you and me\nThe songs of life\nThat somehow make us free\n\nAnd songs to fill the heart\nLike quiet candles on a winter\'s night\nThey touch the space\nThat lies between you and I\nAnd I will sing\nThe songs of love\nThat speak to you and me\n\nThen wake the sleeping child\nAnd let me sing to you of other times\nAnd let me make your dreams\nAs sweet as mine\nAnd I will bring\nThe gift of song\nThat only makes us free\n'),(211,'','2017-11-29 18:32:12','Daylight','f2fafab6-6a82-49ea-99ef-586b3be9da13',213000,0,1,NULL,NULL,21,'\n\n[Intro: Travis McCoy]\r\nYeah,\r\nYou know what it is,\r\nIts your man travis\r\nGym class heroes\r\nKelly Rowland\r\nOh so beautiful\r\nBaby Girl,stay up all night\r\nNow tell \'em ,show\'em how we do\r\nHere we go! Oh!\n\n[Verse 1: Kelly Rowland]\r\nIt\'s five o\'clock am,\r\nAnd the party is still going strong.\r\nThere is a conversation in the corner,\r\nTell a friend, bring everyone.\r\n(C\'mon let\'s go)\r\nCus the FM music is groovin\'\r\nFolks getting down, getting down in \r\nthier shocking feet.\r\nSleepy eyes are peeping,\r\n(They\'re watching baby)\r\nFrom the window across the street\n\n[Chorus:]\r\nAnd it looks like daylight\'s gonna get me up again.\r\n(damn right and im lovin every minute)\r\nMost people like getting up when im just getting in.\r\n(I\'ll be back in three days like Paris\'s jail sentence)\r\nAnd oh, its the only only time,\r\nIts the only time when i can unwind\n\n[Verse 2: Kelly Rowland]\r\nI swore to myself time and time again,\r\nThat I would give up the night life,\r\n(yeah right)\r\nStart laying in.\r\nBut it ain\'t easy, no, no,\r\n(no, no, no)\r\nSaying no to my friends.\r\n(That\'s right)\r\nCus the real, cus the real set don\'t get started,\r\nTill everyone else is in\n\n[Chorus:]\r\nAnd it looks like daylight\'s gonna get me up again.\r\n(damn right and im lovin every minute)\r\nMost people like getting up when im just getting in.\r\n(I\'ll be back in three days like Paris\'s jail sentence)\r\nAnd oh, its the only, only time,\r\nIts the only time when I can unwind.\n\n[Rap:]\r\nHello world, good morning sunshine\r\nGreat to see you again,\r\nHomie, I\'m doin fine\r\nChasin daydreams, you know still pursuing mine,\r\nSleep is so foreign,TV is so boring,\r\nNew York is New York,\r\nTravie is aight,\r\nThe freaks come out at night like a vampire.\r\nNocturnal lurking\r\nThe daylight creeps up \n\n[Chorus:]\r\nAnd it looks like daylight\'s gonna get me up again.\r\n(Damn right and im loving every minute of it)\r\nMost people like getting up when im just getting in.\r\n(I\'ll be back in three days like Paris\'s jail sentence)\r\nDaylight\'s gonna get me up again\r\n(Damn right and im lovin every minute)\r\nMost people like getting up when im just getting in. \n\r\nThis is to my cousin.......Beyonce\r\nThis is to my bestfriend......Michelle\r\nI love yall...\r\nDAYLIGHT\n'),(212,'','2017-11-29 18:32:58','Daylight (Joey Negro radio edit with rap)','26e2999d-6405-4b06-b00f-b1ced2f0ea1b',209000,0,2,NULL,NULL,21,''),(213,'','2017-11-29 18:33:53','Time to Pretend','629b36f0-0cf0-35bf-88b3-bb0046cced33',261000,0,1,NULL,NULL,22,'\n\r\nI\'m feeling rough I\'m feeling raw I\'m in the prime of my life\nLet\'s make some music make some money find some models for wives\nI\'ll move to Paris, shoot some heroin and fuck with the stars\nYou man the island and the cocaine and the elegant cars\n\nThis is our decision to live fast and die young\nWe\'ve got the vision, now let\'s have some fun\nYeah it\'s overwhelming, but what else can we do?\nGet jobs in offices and wake up for the morning commute?\n\nForget about our mothers and our friends\nWe were fated to pretend, to pretend\nWe were fated to pretend, to pretend\n\nI\'ll miss the playgrounds and the animals and digging up worms\nI\'ll miss the comfort of my mother and the weight of the world\nI\'ll miss my sister, miss my father, miss my dog and my home\nYeah I\'ll miss the boredom and the freedom and the time spent alone\n\nBut there is really nothing, nothing we can do\nLove must be forgotten. Life can always start up anew\nThe models will have children, we\'ll get a divorce\nWe\'ll find some more models, everything must run its course\n\nWe\'ll choke on our vomit and that will be the end\nWe were fated to pretend, to pretend\nWe were fated to pretend, to pretend\n\nYeah yeah yeah\nYeah yeah yeah\nYeah yeah yeah\nYeah yeah yeah\n'),(214,'','2017-11-29 18:33:54','Weekend Wars','99a3f0bb-5d54-3e04-91dc-e4c6fed19d50',275000,0,2,NULL,NULL,22,'\n\r\nEvil S I S to find a shore\nA beast that doesn\'t quiver anymore\nAnd we could crush some plants to paint my walls\nAnd I won\'t try to fight in the weekend wars\nWas I? I was too lazy to bathe\nOr paint or write or try to make a change\nNow I can shoot a gun to kill my lunch\nAnd I don\'t have to love or think too much\n\nInstant battle plans written on the sidewalk\nMental mystics in a twisted metal car\nTried to amplify the sound of light and love\n\nChrist is cursed of fathers and martyrs\nMight even take a knife to split a hair\nOr even scare the children off my lawn\nGiving us time to make the makeshift bombs\nEvery mess invested was a score\nWe couldn\'t use computers anymore\nIt\'s difficult to win unless you\'re bored\nAnd you might have to plan for the weekend wars\n\nTry to break my heart I\'ll drive to Arizona\nIt might take a 100 years to grow an arm\nI\'ll sit and listen to the sound of sand and cold\nTwisted diamond heart, I\'m the weekend warrior\nMy predictions are the only things I have\nI can amplify the sound and light and love\n\nI\'m a curse and I\'m a sound\nWhen I open up my mouth\nThere\'s a reason I don\'t win\nI don\'t know how to begin\n'),(215,'','2017-11-29 18:34:45','First We Take Manhattan','97c09d54-e86e-49b8-b8a9-a7f08dcd5562',361066,0,1,NULL,NULL,23,'\n\r\nThey sentenced me to twenty years of boredom \nFor trying to change the system from within \nI\'m coming now, I\'m coming to reward them \nFirst we take Manhattan, then we take Berlin \nI\'m guided by a signal in the heavens \nI\'m guided by this birthmark on my skin \nI\'m guided by the beauty of our weapons \nFirst we take Manhattan, then we take Berlin \n\nI\'d really like to live beside you, baby \nI love your body and your spirit and your clothes \nBut you see that line there moving through the station? \nI told you, I told you, told you, I was one of those \n\nAh you loved me as a loser, but now you\'re worried that I just might win \nYou know the way to stop me, but you don\'t have the discipline \nHow many nights I prayed for this, to let my work begin \nFirst we take Manhattan, then we take Berlin \n\nI don\'t like your fashion business mister \nAnd I don\'t like these drugs that keep you thin \nI don\'t like what happened to my sister \nFirst we take Manhattan, then we take Berlin \n\nI\'d really like to live beside you, baby ... \n\nAnd I thank you for those items that you sent me \nThe monkey and the plywood violin \nI practiced every night, now I\'m ready \nFirst we take Manhattan, then we take Berlin \n\nI am guided \n\nAh remember me, I used to live for music \nRemember me, I brought your groceries in \nWell it\'s Father\'s Day and everybody\'s wounded \nFirst we take Manhattan, then we take Berlin\n'),(216,'','2017-11-29 18:34:46','Ain\'t No Cure for Love','7824d953-82f6-4794-bfb3-e4e124f79acc',290933,0,2,NULL,NULL,23,'\n\r\nI loved you for a long, long time \nI know this love is real \nIt don\'t matter how it all went wrong \nThat don\'t change the way I feel \nAnd I can\'t believe that time\'s \nGonna heal this wound I\'m speaking of \nThere ain\'t no cure, \nThere ain\'t no cure, \nThere ain\'t no cure for love \nI\'m aching for you baby \nI can\'t pretend I\'m not \nI need to see you naked \nIn your body and your thought \nI\'ve got you like a habit \nAnd I\'ll never get enough \nThere ain\'t no cure, \nThere ain\'t no cure, \nThere ain\'t no cure for love \n\nThere ain\'t no cure for love \nThere ain\'t no cure for love \nAll the rocket ships are climbing through the sky \nThe holy books are open wide \nThe doctors working day and night \nBut they\'ll never ever find that cure for love \nThere ain\'t no drink no drug \n(Ah tell them, angels) \nThere\'s nothing pure enough to be a cure for love \n\nI see you in the subway and I see you on the bus \nI see you lying down with me, I see you waking up \nI see your hand, I see your hair \nYour bracelets and your brush \nAnd I call to you, I call to you \nBut I don\'t call soft enough \nThere ain\'t no cure, \nThere ain\'t no cure, \nThere ain\'t no cure for love \n\nI walked into this empty church I had no place else to go \nWhen the sweetest voice I ever heard, whispered to my soul \nI don\'t need to be forgiven for loving you so much \nIt\'s written in the scriptures \nIt\'s written there in blood \nI even heard the angels declare it from above \nThere ain\'t no cure, \nThere ain\'t no cure, \nThere ain\'t no cure for love \n\nThere ain\'t no cure for love \nThere ain\'t no cure for love \nAll the rocket ships are climbing through the sky \nThe holy books are open wide \nThe doctors working day and night \nBut they\'ll never ever find that cure, \nThat cure for love\n'),(217,'','2017-11-29 18:34:47','Everybody Knows','c11ede18-9828-4ce2-981b-6203444d7e5e',336426,0,3,NULL,NULL,23,'\n\r\nEverybody knows that the dice are loaded \r\nEverybody rolls with their fingers crossed \r\nEverybody knows that the war is over \r\nEverybody knows the good guys lost \r\nEverybody knows the fight was fixed \r\nThe poor stay poor, the rich get rich \r\nThat\'s how it goes \r\nEverybody knows \r\nEverybody knows that the boat is leaking \r\nEverybody knows that the captain lied \r\nEverybody got this broken feeling \r\nLike their father or their dog just died \n\r\nEverybody talking to their pockets \r\nEverybody wants a box of chocolates \r\nAnd a long stem rose \r\nEverybody knows \n\r\nEverybody knows that you love me baby \r\nEverybody knows that you really do \r\nEverybody knows that you\'ve been faithful \r\nAh give or take a night or two \r\nEverybody knows you\'ve been discreet \r\nBut there were so many people you just had to meet \r\nWithout your clothes \r\nAnd everybody knows \n\r\nEverybody knows, everybody knows \r\nThat\'s how it goes \r\nEverybody knows \n\r\nEverybody knows, everybody knows \r\nThat\'s how it goes \r\nEverybody knows \n\r\nAnd everybody knows that it\'s now or never \r\nEverybody knows that it\'s me or you \r\nAnd everybody knows that you live forever \r\nAh when you\'ve done a line or two \r\nEverybody knows the deal is rotten \r\nOld Black Joe\'s still pickin\' cotton \r\nFor your ribbons and bows \r\nAnd everybody knows \n\r\nAnd everybody knows that the Plague is coming \r\nEverybody knows that it\'s moving fast \r\nEverybody knows that the naked man and woman \r\nAre just a shining artifact of the past \r\nEverybody knows the scene is dead \r\nBut there\'s gonna be a meter on your bed \r\nThat will disclose \r\nWhat everybody knows \n\r\nAnd everybody knows that you\'re in trouble \r\nEverybody knows what you\'ve been through \r\nFrom the bloody cross on top of Calvary \r\nTo the beach of Malibu \r\nEverybody knows it\'s coming apart \r\nTake one last look at this Sacred Heart \r\nBefore it blows \r\nAnd everybody knows \n\r\nEverybody knows, everybody knows \r\nThat\'s how it goes \r\nEverybody knows \n\r\nOh everybody knows, everybody knows \r\nThat\'s how it goes \r\nEverybody knows \n\r\nEverybody knows\n'),(218,'','2017-11-29 18:34:48','I’m Your Man','078a7810-0f3a-4a20-9400-5abc32fb7586',268440,0,4,NULL,NULL,23,'\n\r\nIf you want a lover \nI\'ll do anything you ask me to \nAnd if you want another kind of love \nI\'ll wear a mask for you \nIf you want a partner \nTake my hand \nOr if you want to strike me down in anger \nHere I stand \nI\'m your man \nIf you want a boxer \nI will step into the ring for you \nAnd if you want a doctor \nI\'ll examine every inch of you \nIf you want a driver \nClimb inside \nOr if you want to take me for a ride \nYou know you can \nI\'m your man \n\nAh, the moon\'s too bright \nThe chain\'s too tight \nThe beast won\'t go to sleep \nI\'ve been running through these promises to you \nThat I made and I could not keep \nAh but a man never got a woman back \nNot by begging on his knees \nOr I\'d crawl to you baby \nAnd I\'d fall at your feet \nAnd I\'d howl at your beauty \nLike a dog in heat \nAnd I\'d claw at your heart \nAnd I\'d tear at your sheet \nI\'d say please, please \nI\'m your man \n\nAnd if you\'ve got to sleep \nA moment on the road \nI will steer for you \nAnd if you want to work the street alone \nI\'ll disappear for you \nIf you want a father for your child \nOr only want to walk with me a while \nAcross the sand \nI\'m your man \n\nIf you want a lover \nI\'ll do anything you ask me to \nAnd if you want another kind of love \nI\'ll wear a mask for you\n'),(219,'','2017-11-29 18:34:49','Take This Waltz','ddaaaba4-2006-40cc-927a-5f5d7b9a8050',360026,0,5,NULL,NULL,23,'\n\r\nNow in Vienna there\'s ten pretty women \nThere\'s a shoulder where Death comes to cry \nThere\'s a lobby with nine hundred windows \nThere\'s a tree where the doves go to die \nThere\'s a piece that was torn from the morning \nAnd it hangs in the Gallery of Frost \nAy, Ay, Ay, Ay \nTake this waltz, take this waltz \nTake this waltz with the clamp on its jaws \nOh I want you, I want you, I want you \nOn a chair with a dead magazine \nIn the cave at the tip of the lily \nIn some hallways where love\'s never been \nOn a bed where the moon has been sweating \nIn a cry filled with footsteps and sand \nAy, Ay, Ay, Ay \nTake this waltz, take this waltz \nTake its broken waist in your hand \n\nThis waltz, this waltz, this waltz, this waltz \nWith its very own breath of brandy and Death \nDragging its tail in the sea \n\nThere\'s a concert hall in Vienna \nWhere your mouth had a thousand reviews \nThere\'s a bar where the boys have stopped talking \nThey\'ve been sentenced to death by the blues \nAh, but who is it climbs to your picture \nWith a garland of freshly cut tears? \nAy, Ay, Ay, Ay \nTake this waltz, take this waltz \nTake this waltz it\'s been dying for years \n\nThere\'s an attic where children are playing \nWhere I\'ve got to lie down with you soon \nIn a dream of Hungarian lanterns \nIn the mist of some sweet afternoon \nAnd I\'ll see what you\'ve chained to your sorrow \nAll your sheep and your lilies of snow \nAy, Ay, Ay, Ay \nTake this waltz, take this waltz \nWith its \"I\'ll never forget you, you know!\" \n\nThis waltz, this waltz, this waltz, this waltz ... \n\nAnd I\'ll dance with you in Vienna \nI\'ll be wearing a river\'s disguise \nThe hyacinth wild on my shoulder, \nMy mouth on the dew of your thighs \nAnd I\'ll bury my soul in a scrapbook, \nWith the photographs there, and the moss \nAnd I\'ll yield to the flood of your beauty \nMy cheap violin and my cross \nAnd you\'ll carry me down on your dancing \nTo the pools that you lift on your wrist \nOh my love, Oh my love \nTake this waltz, take this waltz \nIt\'s yours now. It\'s all that there is\n'),(220,'','2017-11-29 18:34:50','Jazz Police','16dabed0-6446-449f-838f-ef13e7e5cab3',233666,0,6,NULL,NULL,23,'\n\r\nCan you tell me why the bells are ringing? \nNothing\'s happened in a million years \nI\'ve been sitting here since Wednesday morning \nWednesday morning can\'t believe my ears \nJazz police are looking through my folders \nJazz police are talking to my niece \nJazz police have got their final orders \nJazzer, drop your axe, it\'s Jazz police! \n\nJesus taken serious by the many \nJesus taken joyous by a few \nJazz police are paid by J. Paul Getty \nJazzers paid by J. Paul Getty II \n\nJazz police I hear you calling \nJazz police I feel so blue \nJazz police I think I\'m falling, \nI\'m falling for you \n\nWild as any freedom loving racist \nI applaud the actions of the chief \nTell me now oh beautiful and spacious \nAm I in trouble with the Jazz police? \n\nJazz police are looking through my folders ... \n\nThey will never understand our culture \nThey\'ll never understand the Jazz police \nJazz police are working for my mother \nBlood is thicker margarine than grease \n\nLet me be somebody I admire \nLet me be that muscle down the street \nStick another turtle on the fire \nGuys like me are mad for turtle meat \n\nJazz police I hear you calling \nJazz police I feel so blue \nJazz police I think I\'m falling, \nI\'m falling for you\n'),(221,'','2017-11-29 18:34:50','I Can\'t Forget','fafd98cd-6409-4846-8988-d7e2ee03ee1b',271973,0,7,NULL,NULL,23,'\n\r\nI stumbled out of bed \r\nI got ready for the struggle \r\nI smoked a cigarette \r\nAnd I tightened up my gut \r\nI said this can\'t be me \r\nMust be my double \r\nAnd I can\'t forget, I can\'t forget \r\nI can\'t forget but I don\'t remember what \r\nI\'m burning up the road \r\nI\'m heading down to Phoenix \r\nI got this old address \r\nOf someone that I knew \r\nIt was high and fine and free \r\nAh, you should have seen us \r\nAnd I can\'t forget, I can\'t forget \r\nI can\'t forget but I don\'t remember who \n\r\nI\'ll be there today \r\nWith a big bouquet of cactus \r\nI got this rig that runs on memories \r\nAnd I promise, cross my heart, \r\nThey\'ll never catch us \r\nBut if they do, just tell them it was me \n\r\nYeah I loved you all my life \r\nAnd that\'s how I want to end it \r\nThe summer\'s almost gone \r\nThe winter\'s tuning up \r\nYeah, the summer\'s gone \r\nBut a lot goes on forever \r\nAnd I can\'t forget, I can\'t forget \r\nI can\'t forget but I don\'t remember what\n'),(222,'','2017-11-29 18:34:51','Tower of Song','3a641978-f2a0-45f9-9667-530b6dd8a786',337493,0,8,NULL,NULL,23,'\n\r\nWell my friends are gone and my hair is grey \nI ache in the places where I used to play \nAnd I\'m crazy for love but I\'m not coming on \nI\'m just paying my rent every day \nOh in the Tower of Song \nI said to Hank Williams: how lonely does it get? \nHank Williams hasn\'t answered yet \nBut I hear him coughing all night long \nA hundred floors above me \nIn the Tower of Song \n\nI was born like this, I had no choice \nI was born with the gift of a golden voice \nAnd twenty-seven angels from the Great Beyond \nThey tied me to this table right here \nIn the Tower of Song \n\nSo you can stick your little pins in that voodoo doll \nI\'m very sorry, baby, doesn\'t look like me at all \nI\'m standing by the window where the light is strong \nAh they don\'t let a woman kill you \nNot in the Tower of Song \n\nNow you can say that I\'ve grown bitter but of this you may be sure \nThe rich have got their channels in the bedrooms of the poor \nAnd there\'s a mighty judgement coming, but I may be wrong \nYou see, you hear these funny voices \nIn the Tower of Song \n\nI see you standing on the other side \nI don\'t know how the river got so wide \nI loved you baby, way back when \nAnd all the bridges are burning that we might have crossed \nBut I feel so close to everything that we lost \nWe\'ll never have to lose it again \n\nNow I bid you farewell, I don\'t know when I\'ll be back \nThere moving us tomorrow to that tower down the track \nBut you\'ll be hearing from me baby, long after I\'m gone \nI\'ll be speaking to you sweetly \nFrom a window in the Tower of Song \n\nYeah my friends are gone and my hair is grey \nI ache in the places where I used to play \nAnd I\'m crazy for love but I\'m not coming on \nI\'m just paying my rent every day \nOh in the Tower of Song\n'),(223,'','2017-11-29 18:35:38','An Introduction to Indian Music','e9dbbe2e-633d-3809-ae05-6241000a312f',254000,0,1,NULL,NULL,24,''),(224,'','2017-11-29 18:35:38','Dádrá','5df5b66e-a489-3a71-af94-2b2a1218de43',631000,0,2,NULL,NULL,24,''),(225,'','2017-11-29 18:35:38','Máru-bihág','1927eea9-24d0-3e46-a856-d31050eaafb7',705000,0,3,NULL,NULL,24,''),(226,'','2017-11-29 18:35:38','Bhimpalási','ad87c574-4b85-3858-9ec5-7677cebfc9ac',73400