ou\'ve gotta give for what you take\nFreedom\nFreedom\nFreedom\nYou\'ve gotta give for what you take\n\nWell it looks like the road to heaven\nBut it feels like the road to hell\nWhen I knew which side my bread was buttered\nI took the knife as well\nPosing for another picture\nEverybody\'s got to sell\nBut when you shake your ass\nThey notice fast\nAnd some mistakes were built to last\n\nThat\'s what you get\nThat\'s what you get\nThat\'s what you get\nI say that\'s what you get\nThat\'s what you get for changing your mind\nThat\'s what you get for changing your mind\n\nThat\'s what you get\nThat\'s what you get\nAnd after all this time\nI just hope you understand\nSometimes the clothes\nDo not make the man\n\nAll we have to do now is take these lies\nAnd make them true somehow\nAll we have to see is that i don\'t belong to you\nAnd you don\'t belong to me yea yea\nFreedom\nFreedom\nFreedom\nYou\'ve got to give for what you take\nFreedom\nFreedom\nFreedom\nYou\'ve got to give for what you take\nYea you\'ve got to give for what you, give for what you give\n\nMay not be what you want from me\nJust the way it\'s got to be\nLose the face now\nI\'ve got to live I\'ve got to live\n'),(384,'','2017-11-29 18:54:58','They Won’t Go When I Go','4feb8f96-c29e-3260-aeec-dd041924f88e',306266,0,3,NULL,NULL,43,'\n\r\nNo more lying friends\r\nWanting tragic ends\r\nThough they do pretend\r\nThey won\'t go when i go\n\r\nAll those bleeding hearts\r\nWith sorrows to impart\r\nWere right here from the start\r\nAnd they won\'t go when i go\n\r\nAnd i\'ll go where i\'ve longed\r\nTo go so long\r\nAway from tears\n\r\nGone from painful cries\r\nAway from saddened eyes\r\nAlong with him i\'ll bide\r\nBecause they won\'t go when i go\n\r\nBig men feeling small\r\nWeak ones standing tall\r\nI will watch them fall\r\nThey won\'t go when i go\n\r\nAnd i\'ll go where i\'ve longed\r\nTo go so long\r\nAway from tears\n\r\nUnclean minds mislead the pure\r\nThe innocent will leave for sure\r\nFor