e it\n'),(386,'','2017-11-29 18:54:59','Cowboys and Angels','42a58d89-f8bd-38a2-940d-ca4947d402ab',434800,0,5,NULL,NULL,43,'\n\r\nWhen your heart\'s in someone else\'s hands\r\nMonkey see and monkey do\r\nTheir wish is your command\r\nYou\'re not to blame\r\nEveryone\'s the same\n\r\nAll you do is love and love is all you do\r\nI should know by now the way i fought for you\r\nYou\'re not to blame\r\nEveryone\'s the same\n\r\nI know you think that you\'re safe\r\nMister\r\nHarmless deception\r\nThat keeps love at bay\r\nIt\'s the ones who resist that we most want to kiss\r\nWouldn\'t you say?\n\r\nCowboys and angels\r\nThey all have the time for you\r\nWhy should i imagine that i\'d be a find for you\r\nWhy should i imagine\r\nThat i\'d have something to say\n\r\nBut that scar on your face\r\nThat beautiful face of yours\r\nIn your heart there\'s a trace\r\nOf someone before\n\r\nWhen your heart\'s in someone else\'s plans\r\nThings you say and things you do\r\nThey don\'t understand\r\nIt\'s such a shame\r\nAlways ends the same\n\r\nYou can call it love but i don\'t think it\'s true\r\nYou should know by now\r\nI\'m not the boy for you\r\nYou\'re not to blame\r\nAlways ends the same\n\r\nI know you think that you\'re safe\r\nSister\r\nHarmless affection\r\nThat keeps things this way\r\nIt\'s the ones who persist for the sake of a kiss\r\nWho will pay\r\nCowboys and angels\r\nThey all take a shine to you\r\nWhy should i imagine that i was designed for you\r\nWhy should i believe\r\nThat you would stay\n'),(387,'','2017-11-29 18:55:00','Waiting for That Day','f55de786-3b7d-3cc9-88fc-e76db59ba716',289960,0,6,NULL,NULL,43,'\n\r\nSo every day I see you in some other face\nThey crack a smile, talk a while\nTry to take your place\nMy memory serves me far too well\n\nI just sit here on this mountain thinking to myself\nYou\'re a fool, boy\nWhy don\'t you go down\nFind somebody\nFind somebody else\nMy memory serves me far too well\n\nIt\'s not as though we just broke up\nI