dreams get the best of me yet.\n\nPull myself together, gonna put on a new face, yeah.\nGonna climb down from the hilltop, baby, Lord, get back in the race.\nCause I got dreams, I got my dreams, to remember, the love we had.\nI got dreams, I got my dreams, to remember, the love we had.\n\nCause I\'m hung up, on dreams,  I\'m never gonna see, yeah.\nLord help me baby, dreams get the best of me yet.\n'),(463,'','2017-11-29 19:04:34','Beatin\' the Odds','d98b5de2-a6b5-409d-ad8a-be9bd6d3f498',219226,0,10,1757,NULL,52,'\n\r\nWell she grabbed me and asked me,\nIf I had a name,\nShe told me she was interested to see,\nIf I could play the game,\nShe said her name was victory,\nShe didn\'t want to know the rules,\nThat\'s just the way I wanted to play,\nIn a game designed for fools.\n\n[Chorus:]\nWe were beatin\' the odds, we were beatin\' the odds,\nWe were beatin\' the odds again,\nWe were gambling with our souls,\nWe were playing to win,\nWe were beatin\' the odds again.\n\nWell I rolled the dice feelin\' cold as ice,\nAnd Victory drew the cards,\nWe knew that loosin\' when the stakes were high,\nCould really hit us hard,\nI strapped into the drivers seat,\nWith Miss Victory by my side,\nShe knew at a glance she was takin\' a chance,\nBy coming along for the ride.\n\n[Chorus:]\nWe were beatin\' the odds, we were beatin\' the odds,\nWe were beatin\' the odds again,\nWe were gambling with our souls,\nWe were playing to win,\nWe were beatin\' the odds again.\n\nTime and space stood still that day,\nWith Victory\'s soul and mine,\nWe were running a race between heaven and hell,\nAnd we could not find the finish line,\nAnd when it was all over we won it in the end,\nWe were splittin\' the prize when she opened her eyes,\nAnd said Baby let\'s try it again.\n\n[Chorus:]\nWe were beatin\' the odds, we were beatin\' the odds,\nWe were beatin\' the odds again,\nWe were gambling with our souls,\nWe were playing to win,\nWe were beatin\' the odds again.\n\n[Chorus:]\nWe were beatin\' the odds, we were beatin\' the odds,\nWe were beatin\' the odds again,\nWe were gambling with our souls,\nWe were playing to win,\nWe were beatin\' the odds again.\n'),(464,'','2017-11-29 19:04:35','Edge of Sundown','8ffd2245-a314-48ee-a93a-9428b32d335a',270666,0,11,1757,NULL,52,'\n\r\nOn the edge of sundown, a man rode into town\nHis clothes were old and dirty like the guns he wore low down\nAnd as he rode the people stared, tried to look on him\nHe\'s the man who\'ll take your life, take your life to boothill\n\nSleeps by day and rides by night\nLike a mongrel always lookin\' for a fight\nGot cold steel a bowie knife, just his way of life\nHe took no one, no not a sound, stares at the edge of town\nOnly time that he\'ll be found, is on the edge of sundown\n\nTake you for your dollars babe, take you for your gold\nMake your life so miserable, he\'s gonna leave you mean and cold\nAnd then he\'ll head on out, to another town\nThe only time when he\'ll be found, is on the edge of sundown\nNext time he\'ll be sundown.\n\nHe\'s a killer and a robber and he\'ll make you grieve\nShoot you in the back or in your sleep\nGot no name or identity\nLivin\' in the wind, he\'s free...\n'),(465,'','2017-11-29 19:04:36','Fall of the Peacemakers','cc4b6b89-b7c8-4310-bd55-0260bf2da53c',485133,0,12,1757,NULL,52,'\n\r\nA king without a sword\nA land without a king\nA truth without a voice\nOne song left to sing\nOne song to sing\n\nA wise man told me there\'s something you should know\nThe way you judge a man is to look into his soul\nAnd you\'ll soon see everything.\n\nA voice from the past cried \"Give peace a chance\"\nHe paid our price now he\'s free at last\nImagine, we called him a dreamer!\nHow many times must good men die?\nHow many tears will the children cry?\n\'Til they suffer no more sadness\nStop the madness,\nOh, stop the madness.\n\nIf ashes are ashes and dust is dust\nAt our journey\'s end then return we must\nTo the sands of the shore\nWhite doves in flight\nPeace to all\nBut tell me why the peacemakers fall\nMust we bury anymore?\n\nThe hush of the crowd as the horse rode by\nA black lace veil hid the tears from her eyes\nAnd we all wept in silence\nHow many times must good men die?\nHow many times will the children cry?\n\'Til they suffer no more sadness\nOh, stop the madness\nOh, stop all the madness.\n'),(466,'','2017-11-29 19:04:38','Freedom (Back to Reality mix)','27360392-3c02-375d-a25e-a46d9fa6b1e2',376400,0,1,NULL,NULL,53,''),(467,'','2017-11-29 19:04:39','Freedom','df254f88-8c10-3afc-adb4-d5e3cacf5da1',392226,0,2,NULL,NULL,53,''),(468,'','2017-11-29 19:04:39','Fantasy','a8f15759-399b-3057-b246-e1c1f106cdc5',301374,0,3,NULL,NULL,53,'\n\r\nOne Day You Say You Love Me\nThe next you tell me you don\'t\nOne day you say you will\nThe next you tell me you won\'t\nHey little baby, there ain\'t much point in hanging around, yeah\n\nOne day you make me feel that your love is in my hands\nOne day you say you\'ll stay\nThe next you\'re changing your plans\nHey little baby, there ain\'t much point in hanging around, yeah\n\n\'Cos if you ain\'t got time for me\nI\'ll find another fantasy\n\nIt\'s kind of funny that you think\nThat I\'m the boy to make you cry\nI can make you happy if only for a while, little baby\nOh little baby, I can give you all the loving that your heart desires\n\n\'Cos if you ain\'t got time for me\nI\'ll find another fantasy\n\nI said it could be the price of love\nCould be the price of hate\nWhat am I guilty of?\nWhy do you make me wait so long?\nI don\'t know your intentions\nLook to the skies above\nI\'m in the hands of fate\nPush \'til it gets to shove\nI\'ve got to know for heavens sake is this love, is this love or invention\n\n\'Cos baby can\'t you see\nI\'ll find another fantasy\n\nYou hang around with people who you are sure make you cry\nAnd I can make you happy if only for a while, little baby\nOh little baby, I can give you all the loving that your heart desires\n\nIf only for a while little baby\nOh little baby, I can give you all the loving that your heart desires\n\n\'Cos if you ain\'t got time for me\nI\'ll find another fantasy\n\nYou take someone\'s heart and you kick it around\nKeep on picking it up so you can watch it come down\nI don\'t know what I\'m supposed to do\nWhy I wait for you to make up your mind\nCould you please be so kind\nWhen you know what to do\nI\'ll be in the next room\nBut if you leave it too late I may be in the next state\n'),(469,'','2017-11-29 19:05:36','Main Title / Looks Like a Suicide','bf41cf7d-d9d4-4f36-800e-ecd4c11307dc',239200,0,1,1760,NULL,54,''),(470,'','2017-11-29 19:05:37','The John Dunbar Theme','76da7beb-c139-4b09-bc2b-6756aba1af34',137133,0,2,1760,NULL,54,''),(471,'','2017-11-29 19:05:38','Journey to Fort Sedgewick','ccd70ea7-c1ae-43a2-8cd6-a2dc14fcafd6',205600,0,3,1760,NULL,54,''),(472,'','2017-11-29 19:05:38','Ride to Fort Hayes','c5925464-2110-4651-b518-d67133f278f3',120866,0,4,1760,NULL,54,''),(473,'','2017-11-29 19:05:39','The Death of Timmons','09e3dbf9-d10e-42f7-bfd7-ece07101bd35',145026,0,5,1760,NULL,54,''),(474,'','2017-11-29 19:05:40','Two Socks / The Wolf Theme','c96398cf-f9aa-4f5a-9983-269b7b903276',90200,0,6,1760,NULL,54,''),(475,'','2017-11-29 19:05:40','Pawnee Attack','ad9c3a6c-47fd-4344-a15b-2a56899a8b46',229173,0,7,1760,NULL,54,''),(476,'','2017-11-29 19:05:41','Kicking Bird’s Gift','3509689e-016a-4166-bb7d-6e5090373984',130826,0,8,1760,NULL,54,''),(477,'','2017-11-29 19:05:42','Journey to the Buffalo Killing Ground','e4ed523f-f0cf-4b20-aa5b-60ce7b6ae0b8',222973,0,9,1760,NULL,54,''),(478,'','2017-11-29 19:05:43','The Buffalo Hunt','244390c2-1a4a-4d80-8e91-cd023299f52e',163293,0,10,1760,NULL,54,''),(479,'','2017-11-29 19:05:44','Stands With a Fist Remembers','53738151-7657-4bdd-ac70-371973e02841',128666,0,11,1760,NULL,54,''),(480,'','2017-11-29 19:05:48','The Love Theme','2ddd9680-54d1-4e5b-a478-e158368daac3',234906,0,12,1760,NULL,54,''),(481,'','2017-11-29 19:05:48','The John Du