n missed. \r\nI\'ve seen color changed by a kiss. \r\nAsk my brother\r\nAnd my sister. \n\r\nMy sister and her boyfriend slept in the park.\r\nShe had to leave home \'cause he was dark. \r\nNow they parade around in New York with a baby boy... \r\nHe\'s gorgeous! \r\nAin\'t nobody leaving! \n\r\nNo one\'s leaving!\n\r\nYeah, that\'s right... \r\nYeah, that\'s so... \n\r\nWish I knew everyone\'s nickname, \r\nall their slang and all their sayings. \r\nEvery way to show affection,\r\nHow to dress to fit the occasion...\n\r\nWish we all waved... \r\nAll waved...\r\nAll waved...\r\nI wish we all! \r\nWish we all! \r\nWish we all waved...\n'),(493,'','2017-11-29 19:08:00','Ain’t No Right','aca9e51e-b7a3-3c79-ba77-9b1a6f22c015',216600,0,3,NULL,NULL,56,'\n\r\nI am skin and bones, I am pointy nose; \r\nBut it motherfuckin\' makes me try.\r\nMakes me try, and that ain\'t no wrong. \r\nI\'ll tell you why... \r\nThere ain\'t no right! \n\r\nAin\'t no wrong now, ain\'t no right.\r\nAin\'t no wrong now, ain\'t no right. \r\nOnly pleasure and pain.\n\r\nMotherfuckin\' bad wind came, blew down my home. \r\nNow the green grass grows.\r\nBad wind came, blew down my home.\r\nGoddamn goodness knows!\r\nWhere green grass grows there can\'t be wrong.\r\nAnd goodness knows, there ain\'t no right!\n\r\nAin\'t no wrong now, ain\'t no right. \r\nAin\'t no wrong now, ain\'t no right.\r\nOnly pleasure and pain. \n\r\nBumped my head, I\'m a battering ram. \r\nGoddamn took the pain. \r\nCut myself, said So what?\r\nMotherfuckin\' took the pain. \r\nSaid So what? I can\'t be wrong.\r\nI thought so but there ain\'t no right! \n\r\nAin\'t no wrong now, ain\'t no right.\r\nAin\'t no wrong now, ain\'t no right.\r\nOnly pleasure and pain.\n'),(494,'','2017-11-29 19:08:01','Obvious','af7e8c5b-9b66-3cd3-bb5b-0795abf43d5a',357773,0,4,NULL,NULL,56,'\n\r\nHey, you don\'t know me! \r\nYou don\'t know me\r\nBut you just keep on looking at me down low. \r\nOh no! \n\r\nDigging something up... \r\nDigging something up...\r\nAlways digging something up... \r\nOh no! \n\r\nHey you! I don\'t know you. \r\nI don\'t even want to,\r\nBut you just keep looking at me down low. \r\nOh no! \n\r\nDigging something up... \r\nDigging something up... \r\nAlways digging something up...\r\nOh no! \n\r\nAnd you make it so... \r\nMake it so obvious... \r\nHey you! Fools don\'t fit in\r\nThe boots that I tread in, \r\nBut you just keep on looking at me down low. \r\nOh no! \n\r\nDigging something up... \r\nDigging something up... \r\nAlways digging something up... \r\nOh no! \n\r\nAnd you make it so...\r\nBut do you get it? \r\nMake it so...\r\nYou never get it.\r\nYou got to owe me something \r\nBefore you know what is joke and what is up. \r\nI worked my fingers to the bone\r\nAnd I won\'t let you stop me going up. \n\r\nWhy do you have to make it\r\nSo-so-so-so-so obvious\r\nOh no... Oh no... Oh no... Oh no...\n'),(495,'','2017-11-29 19:08:02','Been Caught Stealing','122e589e-392e-3def-b564-b072fbc82f49',216320,0,5,NULL,NULL,56,'\n\r\nI\'ve been caught stealing; \nonce when I was 5... \nI enjoy stealing. \nIt\'s just as simple as that.\nWell, it\'s just a simple fact. \nWhen I want something,\nI don\'t want to pay for it. \n\nI walk right through the door. \nWalk right through the door. \nHey all right! If I get by, it\'s mine. \nMine all mine! \n\nMy girl, she\'s one too.\nShe\'ll go and get her a skirt. \nStick it under her shirt. \nShe grabbed a razor for me. \nAnd she did it just like that. \nWhen she wants something,\nShe don\'t want to pay for it. \n\nShe walk right through the door. \nWalk right through the door.\nHey all right! If I get by, it\'s mine.\nMine all mine!\n\nWe sat around the pile. \nWe sat and laughed. \nWe sat and laughed and\nWaved it into the air! \nAnd we did it just like that. \nWhen we want something,\nWe don\'t want to pay for it.\n\nWe walk right through the door. \nWalk right through the door. \nHey, all right! If I get by, it\'s mine,\nMine, mine, mine, mine, mine, mine...\n'),(496,'','2017-11-29 19:08:03','Three Days','5137253a-8d08-3cba-9437-0f4761831ad7',650466,0,6,NULL,NULL,56,''),(497,'','2017-11-29 19:08:03','Then She Did…','7211ccef-a644-341e-a5ce-e84b191a5a62',500453,0,7,NULL,NULL,56,'\n\r\nNow her paints are dry... \r\nAnd I looked outside... \r\nAt the corner boys...\n\r\nAyh, oh, where did you go? \r\nI don\'t know. \n\r\nI went to see your pictures...\r\nI spread them across the floor... \r\nSo this is where they are shown... \r\nNow they\'re probably saying to you, \r\nIf you keep it up you\'ll be born.\n\r\nBut you won\'t ever listen, \r\nI\'ll bet... \n\r\nBurnt out, grass scorched by the sun. \r\nThe buildings remain. \n\r\nWe will beat them all to dust, \r\nI\'ll bet...\n\r\nPulled from a headless shell\r\nThat blinked on and off, Hotel.\r\nNow the nameless dwell. \n\r\nThey hold your key and turn your knob, \r\nI\'ll bet... \n\r\nWill you say hello to my ma? \r\nWill you pay a visit to her? \r\nShe was an artist, just as you were. \r\nI\'d have introduced you to her. \n\r\nShe would take me out on Sundays. \r\nWe\'d go laughing through the garbage. \r\nShe repaired legs like a doctor\r\nOn the kitchen chairs we sat on. \n\r\nShe was unhappy, just as you were. \r\nUnhappy, just as you were. \r\nUnhappy, just as you were. \r\nUnhappy, just as you were...\n'),(498,'','2017-11-29 19:08:04','Of Course','76dda773-562c-3d69-be5a-3c497f11472b',423986,0,8,NULL,NULL,56,'\n\r\nOf course this land is dangerous! \r\nAll of the animals\r\nAre capably murderous.\n\r\nWhen I was a boy,\r\nMy big brother held on to my hands, \r\nThen he made me slap my own face. \r\nI looked up to him then, and still do. \r\nHe was trying to teach me something. \r\nNow I know what it was! \r\nNow I know what he meant! \r\nNow I know how it is! \n\r\nOne must eat the other\r\nWho runs free before him. \r\nPut them right into his mouth \r\nWhile fantasizing the beauty of his movements. \r\nA sensation not unlike\r\nSlapping yourself in the face... \r\nSlapping yourself in the face...\r\nSlapping yourself in the face...\n'),(499,'','2017-11-29 19:08:05','Classic Girl','dc71c467-55e3-3a12-b891-da9f92db8d27',307866,0,9,NULL,NULL,56,'\n\r\n4:05;\r\nIn my neighborhood,\r\nWhen shots go off,\r\nNo one bothers. \r\nA POP, and a reply POP, and no reply...\n\r\nDinosaurs on the quilt I wore\r\nWith a girl. \r\nSuch a classic girl... \r\nSuch a classic girl... \r\nSuch a classic girl,\n\r\nGives her man great ideas. \r\nHears you tell your friends, \r\nHey man, listen to my great idea!\r\nIt\'s true I am a villain\r\nWhen you fall ill, \r\nthat\'s probably because\n\r\nMen never can be. \r\nNot like a girl. \r\nA classic girl... \r\nSuch a classic girl... \n\r\nThey may say, Those were the days...,\r\nBut in a way,\r\nYou know for us these are the days. \r\nYes, for us these are the days,\n\r\nAnd you know you\'re my girl! \r\nSuch a classic girl... \r\nSuch a classic girl... \n\r\nYeah for us these are the days...\n'),(500,'','2017-11-29 19:08:58','Turn Your Love Around','1635e63d-02b2-38ef-81e6-c1961fe31d75',231333,0,1,NULL,NULL,57,'\n\r\nYou\'ve got the love\nYou\'ve got the power\nBut you just don\'t understand\nGirl, you\'ve been charging by the hour\nFor your love\n\nI\'m tryin\' to show how much I love you\nStill believe in romance\nYou\'re taking way too many chances\nWith my love\n\nI remember\nWhen you used to be\nThe talk of the town\nAll you get is lonely\n\nTurn your love around\nDon\'t you turn me down\nI can show you how\nTurn your love around\n\nWithout the woman I can make it\nBut I need the girl to stay\nOh, don\'t you let the lady take it\nAll away\nWhen the woman need\'s\nA taste of yesterday\nBut you stay at home\nAll they get is lonely\n\nTurn your love around\nDon\'t you turn me down\nI can show you how\nTurn your love around\n\nOh, girl you know me\nI\'m alone until you show me\nThat you\'re still in love with me\nWe\'re gonna make it\nYou\'re gonna take it\nBack where we belong\n\nTurn your love around\nDon\'t you turn me down\nI can show you how\nTurn your love around\n(Turn your love around)\n\nTurn your love around\nThis time the girl became a woman\nDon\'t you turn me down\nEvery woman needs a man\nI can show you how\nI love the girl\nI love the woman\nTurn your love around\n(Turn your love around)\n\nTurn your love around\nThis time the girl became a woman\nDon\'t you turn me down\nEvery woman needs a man\nI can show you how\nI love the girl\nI love the woman\nTurn your love around\n(Turn your love around)\n\nTurn your love around\nThis time the girl became a woman\nDon\'t you turn me down\nEvery woman needs a man\nI can show you how\n'),(501,'','2017-11-29 19:08:58','Love All the Hurt Away','46ca2788-7bba-3408-8d8e-b257e9cbf9ea',250040,0,2,NULL,NULL,57,''),(502,'','2017-11-29 19:08:59','Give Me the Night (edit)','415a4218-546c-3b46-a803-64c0f5e24d43',223160,0,3,NULL,NULL,57,''),(503,'','2017-11-29 19:09:00','Never Give Up on a Good Thing','69c83e22-97d1-3e9d-a6c0-3c9b81495749',246240,0,4,NULL,NULL,57,'\n\r\nNever give up on a good thing\nRemember what makes you happy (Whoa, whoa)\nNever give up on a good thing\nIf love is what you got, you\'ve got a lot\n\nMoney\'s tight, he\'s workin\' every night\nIt ain\'t easy to keep the flame alive\nAnd when he finally comes home to ya\nHe\'s just too tired to do the things you want to\n\nYou can\'t help but wonder to yourself\nHow would it be with someone else\nJust keep in mind, every storm ends in time\nLove is forever, stay together\n\n(Stay together) When you got something real\n(Love forever) That you may never feel again\n\nNever give up on a good thing\nRemember what makes you happy (Whoa, whoa)\nNever give up on a good thing\nIf love is what you got, you\'ve got a lot\n\nNow you\'re the man, you\'ve got to understand\nShe don\'t mean to make a scene\nLike you, she feels all the weight you\'re under\nAnd when she breaks, is it any wonder\n\nI know sometimes it crosses your mind\nTo get on out and stay hard to find\nBefore you try, you\'d better look in her eyes\nLove is forever, stay together\n\n(Stay together) You\'ve got something real\n(Love forever) That you may never feel again\n(You\'ve got a lot)\n\n(Stay together)\n(Love forever)\nYou\'ve got something real\nThat you may never feel again\n\nNever give up on a good thing\nRemember what makes you happy (Oh, oh)\nNever give up on a good thing\nIf love is what you got, you\'ve got a lot\n\nDon\'t give up your good thing\nDon\'t give it, oh, don\'t, oh, oh\nDon\'t give up your good thing\nPlease don\'t, oh, don\'t\nDon\'t live it up, don\'t give it up\n\nNever give up on a good thing\nRemember what makes you happy (Oh, oh)\nNever give up on a good thing\nIf love is what you got, you\'ve got a lot\n\nNever give up on a good thing (Oh, he\'s all you need)\nRemember what makes you happy (Whoa, whoa)\nNever give up on a good thing\nIf love is what you got, you\'ve got a lot\n\nNever give up on a good thing (Oh, he\'s all you need)\nRemember what makes you happy (Whoa, oh)\nNever give up on a good thing\n'),(504,'','2017-11-29 19:09:01','On Broadway','9c35e8e9-45a4-3f7e-8796-fafb9947c4bf',318133,0,5,NULL,NULL,57,'\n\r\nThey say the neon lights are bright on broadway\nThey say there\'s always magic in the air\nBut when you\'re walkin\' down that street\nAnd you ain\'t had enough to eat\nThe glitter rubs right off and you\'re nowhere\n\nThey say the women treat you fine on Broadway\nBut looking at them just gives me the blues\n\'Cause how ya gonna make some time\nWhen all you got is one thin dime\nAnd one thin dime won\'t even shine your shoes\n\nThey say that I won\'t last too long on Broadway\nI\'ll catch a Greyhound bus for home, they all say\nBut they\'re dead wrong, I know they are\n\'Cause I can play this here guitar\nAnd I won\'t quit till I\'m a star on Broadway\n\nI won\'t quit till I\'m a star on Broadway\n'),(505,'','2017-11-29 19:09:02','White Rabbit','ea5f37a0-9d15-3b74-9790-de1e9ca11ffd',418800,0,6,NULL,NULL,57,''),(506,'','2017-11-29 19:09:02','This Masquerade (Edit)','24f4eed1-03c9-3578-8192-d399bcf0c558',199426,0,7,NULL,NULL,57,''),(507,'','2017-11-29 19:09:03','Love Ballad','1d022638-38bc-3036-bf6e-d851c0110e3c',257373,0,8,NULL,NULL,57,'\n\r\nI have never been so much\nIn love, in love before\nWhat a difference\nHow true love made in my life\nSo nice and so right\n\nLovers come and then lovers go\nThat\'s what the people say\nDon\'t they know\nHow it feels when you love me\nHold me and say you care\nAnd what we have is much more than they can see\nAnd what we have is much more than they can see\nBaby what we have is much more than they see\nOh baby, whoa yeah\n\nI\'m in love, I\'m in love with you girl\n\nI say love I never knew that a touch\nCould mean, could mean so much\nWhat a difference\nAnd when we walk hand in hand\nI feel, I feel so real\n\nLovers come and then lovers go\nThat\'s what the people say\nDon\'t they know\nHow I feel when you love me\nHold me and say you care\nAnd what we have is much more than they can see\nAnd what we have is much more than they can see\nBaby, what we have is much more than they can see\n\nOh, yeah\n'),(508,'','2017-11-29 19:09:04','Nature Boy','800776f0-34c2-3396-b358-13446c740c5f',260733,0,9,NULL,NULL,57,'\n\r\nThere was a boy\n\nVery strange\nEnchanted boy;\nThey say be wander\'d very far\n\nVery far over land and sea.\nA little shy and sad of eye\nBut very wise\nVery wise was be.\n\nAnd then one day\n\nA magic day he passed my way\n\nAnd while we spoke of many things\n\nFools and kings\nThis he said to me:\nThe greatest thing you\'ll ever learn\nIs just to love and be loved in return\nTo be loved in return.\n\nAnd then one day...\n'),(509,'','2017-11-29 19:09:05','Last Train to Clarksville','55efd41a-c19a-3cca-90d3-b9c7f4b4eae5',301266,0,10,NULL,NULL,57,''),(510,'','2017-11-29 19:09:06','Livin\' Inside Your Love','5b2415b6-bafd-3c4a-9437-8e2ced1a0ce5',398826,0,11,NULL,NULL,57,''),(511,'','2017-11-29 19:09:07','Here Comes the Sun','39b47390-dc36-38af-bf0d-bd959e85aaff',153933,0,12,NULL,NULL,57,''),(512,'','2017-11-29 19:09:07','Breezin\'','1ff226e9-a411-3527-a448-7dd61b45362f',339533,0,13,NULL,NULL,57,''),(513,'','2017-11-29 19:09:08','Moody’s Mood','a675b223-c85a-381c-a9fd-0afd89b48db3',206773,0,14,NULL,NULL,57,'\n\r\nThere I go, there I go, there I go\nThere I go\n\nPretty baby, you are the soul who snaps my control\nSuch a funny thing but every time you\'re near me\nI never can behave\n\nYou give me a smile and then I\'m wrapped up in your magic\nThere\'s music all around me, crazy music\nMusic that keeps calling me so very close to you\nTurns me your slave\n\nCome and do with me any little thing you want to\nAnything baby, just let me get next to you\nAm I insane or do I really see heaven in your eyes?\nBright as stars that shine up above you in the clear blue skies\nHow I worry about you\n\nJust can\'t live my life without you\nBaby come here, don\'t have no fear\nOh, is there a wonder why\nI\'m really feeling in the mood for love?\nSo tell me why stop to think\nAbout this weather, my dear?\nThis little dream might fade away\nThere I go talking out of my head again, oh baby\nWon\'t you come and put our two hearts together?\n\nThat would make me strong and brave\nOh when we are one, I\'m not afraid, I\'m not afraid\nIf there\'s a cloud up above us\nGo on and let it rain\nI\'m sure our love together will endure a hurricane\nOh my baby\nWon\'t you please let me love you\nAnd give a relief from this awful misery?\n\nWhat is all this talk about loving me, my sweet?\nI am not afraid, not anymore, not like before\nCan\'t you understand me?\n\nNow baby, please pull yourself together, do it soon\nMy soul\'s on fire, come on and take me\nI\'ll be what you make me, my darling, my sweet\n\nOh baby, you make me feel so good\nLet me take you by the hand\nCome let us visit out there\nIn that new promised land\nMaybe there we can find\nA good place to use a loving state of mind\nI\'m so tired of being without\nAnd never knowing what love\'s about\nJames Moody, you can come on in\nAnd you can blow now if you want to\n\nWe\'re through.\n'),(514,'','2017-11-29 19:09:09','We Got the Love','6f43b186-3517-3c7b-a982-cd8a7eb6a94c',208466,0,15,NULL,NULL,57,''),(515,'','2017-11-29 19:09:10','The Greatest Love of All','77cb0c04-40a0-37f2-8c85-a1d56b3d82ce',333266,0,16,NULL,NULL,57,''),(516,'','2017-11-29 19:09:52','Concrete and Steel','379ed462-fc50-368d-8cdc-f339b5c0e0c3',229773,0,1,NULL,NULL,58,'\n\r\nHard and cold, like a street of gold,\r\nIt\'s easy to find but so hard to hold.\r\nSmooth and strong but it won\'t last long,\r\nWhen the rust sets in, she\'ll be good as gone!\n\r\nConcrete, Concrete and steel.\r\nIt\'s like concrete.  \r\nHey baby, what\'s the deal?\n\r\nA heart of stone make you feel alone,\r\nbut what can you do when your hand is blown?\r\nHard as ice, it\'s like tumblin\' dice,\r\nbefore you fall for her boy, you better think twice.\n\r\nConcrete, Concrete and steel.\r\nIt\'s like concrete.  \r\nHey baby, what\'s the deal?\n\r\nDark as night, diamond bright, \r\nNever seen such a strange delight.\r\nSlick as glass, and just as fast,\r\nYou\'ll feel the pain, but it won\'t last.\n'),(517,'','2017-11-29 19:09:53','Lovething','e891618b-9bbb-301c-b1c9-2c9118973adc',205960,0,2,NULL,NULL,58,'\n\r\nIt must have been the way that she kissed me,\r\nmade me as weak as a lamb.  \r\nTastes so fine like french silk pie,\r\nsweet as strawberry jam.\r\nIt could have been the thing that she told me,\r\nwhen she threw her wrench at my monkey.\n\r\nShoulda been a cool scene,\r\nLike honey on a ripped queen.\r\nI thought it was a day-dream,\r\nBut it must have been a lovething.\n\r\nI smiled at the way that she told me,\r\n\"I just can\'t turn you a-loose.\"\r\nShe was a force majeure in her haute couture,\r\nI was howlin\' at the moon.\r\nThat\'s when I jumped out of her window,\r\nBefore my monkey could cook her goose.\n\r\nShoulda been a cool scene,\r\nLike honey on a ripped queen.\r\nI thought it was a day-dream,\r\nBut it must have been a lovething.\n'),(518,'','2017-11-29 19:09:54','Penthouse Eyes','c8635d63-4bc7-3685-9d27-c7442c8f380f',227240,0,3,NULL,NULL,58,'\n\n[Spoken:] What you lookin\' at, girl?\n\r\nShe\'s always checkin\' with her penthouse eyes,\r\nMakes me stutter, gives me butterflies.\r\nGot to have her, she pins me up with her penthouse eyes.\n\r\nI wanna lie where her eagle flies,\r\nShe\'s got my love pressure on the rise.\r\nWhen I see her, she really rocks me with her penthouse eyes.\n\r\nDon\'t need excuse for graspin\',\r\nCan\'t blame the boy for askin\'.\r\nOne look sting you like a honey bee,\r\nBut it\'s her eyes gonna set you free.\n\r\nI wanna stretch her out in old Levi\'s,\r\nGot to have a little piece of paradise.\r\nI got to have her, she pins me up with her penthouse eyes.\n\r\nDon\'t need excuse for graspin\',\r\nCan\'t blame the boy for askin\'.\r\nThere\'s no escape let me tell you no lie,\r\nShe\'s always lookin\' with her penthouse eyes.\n'),(519,'','2017-11-29 19:09:54','Tell It','e2d28231-0353-36ac-aaaf-4dd1a64be308',288693,0,4,NULL,NULL,58,'\n\r\nI gotta find out what\'s in my mind,\r\nI\'m a little mixed up but it feels so fine.\r\nWhy does love have to come and go, \r\nIf it\'s got to leave why does it go so slow?\n\r\nJust tell it...\r\nTell it like it is.\r\nTell it..\r\nTell it like it feels.\r\nTell it to my baby.\n\r\nI have a feelin\' that I\'m goin\' insane,\r\nI\'ve fallen in love but can\'t remember her name.\r\nShe prob\'ly stepped out and she\'s coming back again,\r\nbut if I don\'t know her how can I let her in?\n\r\nJust tell it...\r\nTell it like it is.\r\nTell it..\r\nTell it like it feels.\r\nTell it to my baby.\n\n[Spoken:]\r\nFine!\r\nSo fine!\n\r\nHow could this ever have happened this way?\r\nWell, sometimes love turns out that way.\r\nSometimes it\'s cold and sometimes it\'s hot,\r\nBut it\'s better to have it than to need it and not!\n'),(520,'','2017-11-29 19:09:55','My Head’s in Mississippi','292959e4-1495-343f-96d1-22d2c0f55e9f',265133,0,5,NULL,NULL,58,'\n\r\nI\'m shufflin\' thru the Texas sand,\r\nbut my head\'s in Mississippi.\r\nI\'m shufflin\' thru the Texas sand,\r\nbut my head\'s in Mississippi.\r\nThe blues has got a hold of me.\r\nI believe I\'m gettin\' dizzy.\n[Spoken:] Help me now.\n\r\nI keep thinkin\' \'bout that night in Memphis,\r\nLord, I thought I was in Heaven.\r\nI keep thinkin\' \'bout that night in Memphis,\r\nI thought I was in Heaven.\r\nBut I was stumblin\' thru the parking lot \r\nof an invisible seven eleven.\n[Spoken:] What was I doin out there?\n\r\nWhere\'s my head baby?\r\nSomewhere in Mississippi.\n\r\nLast night I saw a cowgirl.\r\nShe was floatin\' across the ceiling.\r\nAnd last night I saw a naked cowgirl.\r\nShe was floatin\' across the ceiling.\r\nShe was mumblin to some howlin\' wolf\r\nabout some voodoo healin\'.\n[Spoken:] Mmm Baby.\n'),(521,'','2017-11-29 19:09:56','Decision or Collision','56adc66b-ae18-3ceb-b85f-4e9814f09f66',243000,0,6,NULL,NULL,58,'\n\r\nShe\'s so fine, makes me lose my mind,\r\nI wish to apply my manhood.\r\nI\'ll be glad to go to her pad and\r\nMaybe the whole band could.\n\r\nI got to make a decision\r\nTo avoid a collision.\n\r\nShe\'s so tuff, my knee\'s a little rough\r\nFrom crawlin\' on across her floor.\r\nIf she\'d place an order I\'d drink her bath water and\r\nNot even use a chaser.\n\r\nI got to make a decision\r\nTo avoid a collision.\n\r\nHer lips are wet and I\'d make a bet \r\nShe\'s been suckin\' on her watermellon rind.\r\nShe\'s a picture of wealth and I know myself\r\nThat I\'d take what she leaves behind.\n'),(522,'','2017-11-29 19:09:57','Give It Up','5fc13baa-eeaf-303e-8269-63a0be6a9d91',213906,0,7,NULL,NULL,58,'\n\r\nI bet the derby and I won by a nose,\r\nI bet Vegas and they took my clothes.\r\nI bet Monte Carlo I was showin\' my stuff,\r\nI bet on you baby, now ain\'t that enough?\n\r\nYou got to give it up, \r\nGive it up baby.\r\nGive it up.\r\nYou got to give it up, baby, tell me where it\'s at.\n\r\nWell there\'s a few more things you should know about me,\r\nI trained trigger single-handedly.\r\nI invented see-through negligees,\r\nAnd I bought the flying saucer off the Presley estate.\n\r\nYou got to give it up, \r\nYou got to give it up baby.\r\nGive it up.\r\nYou got to give it up, baby, tell me where it\'s at.\n\r\nI fell in love down in Mexico,\r\nThunderbird wine\'s the only way to go.\r\nI been in love ten thousand times, \r\nAll you got to do is remember my line.\n'),(523,'','2017-11-29 19:09:58','2000 Blues','263e4eeb-922f-3b0e-b17c-937da721c9b9',285333,0,8,NULL,NULL,58,'\n\r\nA hundred thousand dollars\r\nwouldn\'t touch the price I paid\r\nof the hundred thousand moments\r\nof the times I wish I\'d stayed.\r\nBut even if I had all the time and money,\r\nit\'s still the same old news.\r\nNothin\' does you any good\r\nwhen you got 2000 blues.\n\r\nTen thousand clouds\r\non a rainy rainy day\r\ncouldn\'t wash away\r\nall the dust and the haze.\r\nBut I tried and I tried\r\nto search for all the clues,\r\nwhy I can\'t wash away\r\nthese 2000 blues.\n\r\nIf I had an airplane\r\nwith a co-pilot too,\r\nI\'d fly to a planet\r\nthat was closest to you.\r\nI\'d set the tracking system\r\nwith your safety fuse,\r\nand set the countdown\r\nfor 2000 blues.\n'),(524,'','2017-11-29 19:09:59','Burger Man','5a144ec6-94e2-35e3-bfed-93cfee066157',199693,0,9,NULL,NULL,58,'\n\r\nMy charcoal\'s getting red hot,\r\nput your order in my hand.\r\nWon\'t you let me show you what I got\r\nsizzlin in the pan.\n\r\nAny way you want it baby,\r\nI am your burger man.\n\r\nIf you need good hot grillin\',\r\ntry my burger stand.\r\nIf you need a slice of thrillin\',\r\nI\'m the baddest in the land.\n\r\nAny way you want it baby,\r\nI am your burger man.\n\n[Spoken:]\r\nDid you want double meat?  \r\nHow \'bout some fries on the side?\n\r\nOnce you try my burger baby,\r\nyou\'ll grow a new thyroid gland.\r\nI said just eat my burger, baby,\r\nmake you smart as Charlie Chan.\n\r\nYou see the hot sauce can\'t be beat.\r\nSit back and open wide.\n'),(525,'','2017-11-29 19:09:59','Doubleback','ea8104cf-cdaa-334c-9999-123d802ef5a1',234800,0,10,NULL,NULL,58,'\n\r\nI got shot through a space not long ago,\r\nI thought I knew the place so well.\r\nIt wasn\'t the same, now it goes to show,\r\nSometime you never can tell.\n\r\nI\'m lookin\' high and low, don\'t know where to go,\r\nI got to double back, my friend.\r\nThe only way to find, what I left behind\r\nI got to double back again, double back again.\n\r\nYou know I\'m movin on in this fine machine, \r\nRollin\' on through the night.\r\nSeein\' things like I\'ve never seen\r\nAnd it\'s taking me outta sight.\n\r\nLookin\' high and low, don\'t know where to go,\r\nI got to double back, my friend.\r\nThe only way to find, what I left behind\r\nI got to double back again, double back again.\n\r\nIt\'s got me up and down,\r\nI been lost and found,\r\nDown in a deep dark hole.\r\nLooks like my luck has changed,\r\nI been rearranged\r\nAnd I\'m coming out on a roll.\n\r\nLookin\' high and low, don\'t know where to go,\r\nI got to double back, my friend.\r\nThe only way to find, what I left behind\r\nI got to double back again, double back again.\n'),(526,'','2017-11-29 19:10:02','I Thank You','e5cf4dac-00cf-3f45-ba97-f8912ba29520',206133,0,1,1769,NULL,59,'\n\r\nYou didn\'t have to love me like you did\r\nBut you did, but you did.\r\nAnd I thank you.\r\nYou didn\'t have to love me like you did\r\nBut you did, but you did.\r\nAnd I thank you.\r\nBut you took your love to someone else\r\nI wouldn\'t know what it meant to be loved to death\n\r\nYou made me feel like I\'ve never felt\r\nKisses so good I had to holler for help\r\nYou didn\'t have to squeeze it but you did\r\nBut you did but you did\r\nAnd I thank you.\r\nYou didn\'t have to hold it but you did\r\nBut you did but you did\r\nAnd I thank you.\n\r\nEvery day was something new,\r\nYou put on your bag and your fine to-do\r\nYou got me trying new things too\r\nJust so I can keep up with you.\n\r\nYou didn\'t have to shake it but you did\r\nBut you did but you did\r\nAnd I thank you.\r\nYou didn\'t have to make it like you did\r\nbut you did but you did\r\nAnd I thank you.\n\r\nAll my life I\'ve been shortchanged\r\nWithout your love baby it\'s a crying shame\r\nBut now I know what the fellas talking about\r\nHear me say that they been turned out\r\nI want to thank you\r\nI want to thank you\r\nI want to thank you\r\nYes, I want to thank you\n'),(527,'','2017-11-29 19:10:03','She Loves My Automobile','1a182951-8e86-3166-94b2-3a3c2f955c4b',143400,0,2,1769,NULL,59,'\n\r\nShe don\'t love me, she love my automobile.\r\nShe don\'t love me, she love my automobile.\r\nWell she would do anything just to slide behind the wheel.\n\r\nShe said what\'s it gonna take for you to lay your top on down?\r\nShe said what\'s it gonna take for you to lay your top on down?\r\nI said honey why don\'t you ask me when we get to the outskirts of town.\n\r\nWell now she don\'t care if I\'m stoned or sloppy drunk.\r\nWell she don\'t care if I\'m stoned or sloppy drunk,\r\nLong as she got the keys and there\'s a spare wheel in her trunk.\n'),(528,'','2017-11-29 19:10:04','I’m Bad, I’m Nationwide','326c0b5c-60f7-3596-b690-ff6cefce1336',293106,0,3,1769,NULL,59,'\n\r\nWell I was rollin\' down the road in some cold blue steel,\r\nI had a bluesman in the back, and a beautician at the wheel.\r\nWe\'re going downtown in the middle of the night\r\nWe was laughing and I\'m jokin\' and we feelin\' alright.\r\nOh I\'m bad, I\'m nationwide.\r\nYes I\'m bad, I\'m nationwide.\n\r\nEasin\' down the highway in a new Cadillac,\r\nI had a fine fox in front, I had three more in the back.\r\nThey sportin\' short dresses, wearin\' spike-heeled shoes,\r\nThey smokin\' Lucky Strikes, wearing nylon too.\r\nWelcome back, we\'re nationwide.\r\nYeah we bad, we\'re nationwide.\n\r\nWell I was movin\' down the road in my V-8 Ford,\r\nI had a shine on my boots, I had my sideburns lowered.\r\nWith my New York brim and my gold tooth displayed,\r\nNobody give me trouble cause they know I got it made.\r\nI\'m bad, I\'m nationwide.\r\nGirl I\'m bad, bad, bad, bad, bad, I\'m nationwide.\n'),(529,'','2017-11-29 19:10:05','A Fool for Your Stockings','221969f6-68df-3fd1-9916-66541267eb18',256760,0,4,1769,NULL,59,'\n\r\nIs it you again outside,\r\nJust banging on the front door?\r\nYou say you had enough,\r\nNow you\'re coming\' back for more,\r\nBut that\'s alright.\r\nI said that that\'s alright.\r\nI may not want to admit it,\r\nI\'m just a fool for your stockings I believe.\n\r\nNow I don\'t mind when you send money\r\nand bring your girlfriends with you,\r\nBut how could one be so thoughtless to try\r\nand handle less than two?\r\nBut that\'s alright.\r\nI said that that\'s alright, baby.\r\nI may not want to admit it,\r\nI\'m just a fool for your stockings I believe.\n\r\nNow I\'m tellin\' everybody\r\nIt seems too good to be true:\r\nSweet things can always get sweeter.\r\nI know mine did, how about you?\r\nYes, it\'s alright.\r\nI said, yes it is, that\'s alright.\r\nI may not want to admit it,\r\nI\'m just a fool for your stockings I believe.\n'),(530,'','2017-11-29 19:10:06','Manic Mechanic','77da45f6-e2a4-394e-a2e1-0e73145c0c51',156333,0,5,1769,NULL,59,'\n\r\nYou want to race?\r\nIf you insist.\r\nAt that price, I can\'t resist,\r\nThat\'s right, that\'s right, that\'s right.\n\r\nTonight it ain\'t right,\r\nI got to have me a week.\r\nBut I\'ll be back for you, Jack,\r\nand I\'ll let the machine speak,\r\nThat\'s right, that\'s right, that\'s right.\n\r\nShowdown, you bet.\r\nAnd I haven\'t saddled my pony yet.\r\nHave mercy, Miss Percy.\r\nI done put the coon tune on this bet, \r\nThat\'s right, that\'s right, that\'s right.\n'),(531,'','2017-11-29 19:10:07','Dust My Broom','3048cab6-03fd-35f2-b97c-5e723b605c9a',189066,0,6,1769,NULL,59,'\n\r\nI\'m gonna get up in the morning\r\nI believe I\'ll dust my broom.\r\nI\'m gonna get up in the morning\r\nI believe I\'ll dust my broom.\r\nWell my best gal I\'ll be leaving\r\nSo my friend, get out my room\n\r\nI\'m gonna write a letter to China\r\nSee if my baby\'s over there.\r\nI\'m gonna write a letter to China\r\nSee if my baby\'s over there.\r\nIf she ain\'t up in the Hawaiian Islands,\r\nMust be in Ethiopia somewhere\n\r\nI believe believe my time alone\r\nI believe believe my time alone\r\nI\'ve had to quit my baby and give up my happy home\n'),(532,'','2017-11-29 19:10:08','Lowdown in the Street','e27a116a-6e12-3f11-91bd-2e20ece89f36',170240,0,7,1769,NULL,59,'\n\r\nWell there comes Lola, out of control-a:\r\nShe just loves those rhythm and blues.\r\nAnd miss Ivy will be arriving;\r\nin leopard skin tights she\'s willing to cruise.\n\r\nIt\'s a fiend scene and it happens \'bout once a week.\r\nSo fork over some bread, it\'ll do your head to get low down in the street.\n\r\nThere\'s Jimmy and Jojo, there\'s Kim and Keith,\r\nWay outside the eyes of cool.\r\nAnd sweet M.B., and there\'s little G.B.\r\nEverybody wants to be their fool.\n\r\nIt\'s a fiend scene and it happens here ev\'ry week.\r\nFork over some bread, it\'ll do your head to get low down in the street.\n\r\nSome nights are lonely, some nights are lazy,\r\nbut ain\'t nobody try and slip away.\r\nThey\'ll make you loose.  They\'ll make you crazy.\r\nKnow what I mean, what you say, what you say.\n\r\nIt\'s a fiend scene and it happens \'bout once a week.\r\nSo roam on in, it ain\'t no sin to get low down in the street.\n'),(533,'','2017-11-29 19:10:09','Hi Fi Mama','5dd3ae74-96ed-3635-9b36-ec69d9751d74',145133,0,8,1769,NULL,59,'\n\r\nI want your hi fi mama, won\'t you let me play it tonight\r\nI want your hi fi mama, won\'t you let me play it tonight\r\nI put the needle in the groove, baby while you douse the lights.\n\r\nI play it on your dresser, play it upside your wall\r\nI play it in your kitchen, even play it in your hall\r\nI play it anywhere you want it, any old time at all.\n\r\nHi fi lo fi no fi\'s just fine with me.\r\nHi fi lo fi no fi\'s just fine with me.\r\nAnd if you want to give me stereo first give me vitamin E.\r\nI got your name and your number.\n'),(534,'','2017-11-29 19:10:09','Cheap Sunglasses','63b8db7b-0216-3f96-aad7-85ec39cfcd64',288400,0,9,1769,NULL,59,'\n\r\nWhen you get up in the morning and the light is hurt your head\r\nThe first thing you do when you get up out of bed\r\nIs hit that street a-runnin\' and try to meet the masses\r\nAnd go get yourself some cheap sunglasses\r\nOh yeah, oh yeah, oh yeah\n\r\nSpied a little thing and I followed her all night\r\nIn a funky fine levis and her sweater\'s kind of tight\r\nShe had a west coast strut that was sweet as molases\r\nBut what really knocked me out was her cheap sunglasses\r\nOh yeah, oh yeah, oh yeah\n\r\nNow go out and get yourself some thick black frames\r\nWith the glass so dark thay won\'t even know your name\r\nAnd the choice is up to you cause they come in two classes\r\nRhinestone shades and cheap sunglasses\r\nOh yeah, oh yeah, oh yeah\n'),(535,'','2017-11-29 19:10:10','Esther Be the One','908dac6e-09d5-3d6d-8f77-12eb74df6839',210666,0,10,1769,NULL,59,'\n\r\nEsther be the one that shoots a machine gun\r\nWhether you like it or not.\r\nMidnight or daylight, stay out of her sight\r\n\'Cuz I heard she\'s one heck of a shot.\r\nEsther be the one, she\'s the only one.\r\nShe\'ll get you with her gun when the wolf starts howlin\' at the moon.\n\r\nAnd you will feel her love bullets when you look her in the eyes.\r\nThere ain\'t no way to escape.\r\nAnd that\'s when her fever will materialize,\r\nBut it ain\'t no unfortunate fate.\r\nEsther be the one, she\'s the only one.\r\nShe\'ll get you with her gun when the wolf starts howlin\' at the moon.\n\r\nIt ain\'t nothin\', but it\'s somethin\' so \"deal\". \r\nDon\'t get branded \'cause her ammo ain\'t real.\n\r\nIf she gets you in a corner, don\'t let her mess you \'round\r\nAnd don\'t let her blow you away.\r\nIf you can\'t dig on Esther, you turn and leave town\r\n\'cause if you think she\'s bad you ought to see her sister.\r\nEsther be the one, but she\'s not the only one.\r\nShe\'ll get you with her gun when the wolf starts howlin\' at the moon.\n'),(536,'','2017-11-29 19:11:25','Just Like You','6c7e9b4c-25b1-3037-ae7f-c59ea612de80',303773,0,1,NULL,NULL,60,''),(537,'','2017-11-29 19:11:25','We Believe','aeceacfb-e86c-3675-b126-46b393fe3530',356533,0,2,NULL,NULL,60,''),(538,'','2017-11-29 19:11:26','All Day (remix)','c292719d-695e-3d88-8a19-f8e31db333d4',363026,0,3,NULL,NULL,60,''),(539,'','2017-11-29 19:11:27','The Angel','247e2406-922f-3d47-838b-e8a024728f63',366706,0,4,NULL,NULL,60,''),(540,'','2017-11-29 19:11:28','Over the Shoulder','8c6b2d32-0707-397f-91f3-c818a94f286f',313560,0,5,NULL,NULL,60,''),(541,'','2017-11-29 19:11:28','My Possession','c56fa075-623e-39ca-9092-cf5530a039f4',305066,0,6,NULL,NULL,60,''),(542,'','2017-11-29 19:11:29','Where You at Now? / Crash and Burn / Twitch (version II)','28c9c362-e647-36c7-b85f-d5589efd1e3b',735306,0,7,NULL,NULL,60,''),(543,'','2017-11-29 19:11:30','Over the Shoulder (12″ version)','100dc9de-248b-3c48-8ba9-a47583cf7394',406293,0,8,NULL,NULL,60,''),(544,'','2017-11-29 19:11:31','Isle of Man (version II)','8f1fb511-169c-3b71-8bc3-5769f011289e',270906,0,9,NULL,NULL,60,''),(545,'','2017-11-29 19:12:18','Falling (edit)','841c1939-5555-36a0-8cb6-f964bf385ae1',252000,0,1,NULL,NULL,61,''),(546,'','2017-11-29 19:12:18','Twin Peaks Theme (Instrumental)','e41fcd83-b125-3680-921a-61d063760be6',285000,0,2,NULL,NULL,61,''),(547,'','2017-11-29 19:12:19','Floating','363e15ac-e9bc-37c3-b2b7-2a9432228f9e',291000,0,3,NULL,NULL,61,''),(548,'','2017-11-29 19:14:12','Skies the Limit','4c784461-742f-3bbc-bc54-7b30aa1bac62',225306,0,1,NULL,NULL,62,''),(549,'','2017-11-29 19:14:13','Love I